export default function UsersList() {
  const [vendors, setVendors] = useState([]);
  const [vendorFoods, setVendorFoods] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5000/food/vendor-food")
      .then((response) => {
        setVendors(response.data);
      })
      .catch((error) => {});
  }, []);

  return (
    <div>
      <br></br>
      <Grid
        container
        alignItems="center"
        spacing={0}
        direction="column"
        sx={{ borderRadius: 16 }}
      >
        <Grid item xs={6}>
          <Paper>
            <Table size="small">
              <TableHead align="center">
                <TableRow>
                  <TableCell>Vendor Name</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {vendors.map((vendor, ind) => (
                  <TableRow key={ind}>
                    <TableCell align="center">
                      {vendor._id}
                      <Button size="small">
                        <FastfoodIcon></FastfoodIcon>
                      </Button>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </Paper>
        </Grid>
      </Grid>
    </div>
  );
}

function ShowVendorFood(props) {
  return (
    <Paper>
      <Table size="small">
        <TableHead align="center">
          <TableRow>
            <TableCell>Item Name</TableCell>
            <TableCell>Price</TableCell>
            <TableCell>Category</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {props.map((props, ind) => (
            <TableRow key={ind}>
              <TableCell align="center">{props.itemName}</TableCell>
              <TableCell align="center">{props.price}</TableCell>
              <TableCell align="center">{props.category}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </Paper>
  );
}
